window.bookSummaryJSON = "<p>After daring escapes and narrow victories, Thomas finds himself not only as the commander of Excalibur, but a symbol of hope to a fledgling resistance movement determined to challenge Morgana’s tyrannical rule.</p> <p><b>There’s a high price to freedom.</b></p> <p>Hidden among the stars, Thomas and his crew must transform from fugitives into fighters, striking where the enemy least expects while gathering strength for the battles to come. Their quest will take them to ancient worlds where forgotten alliances wait to be rekindled, and secrets of both magic and technology lie guarded by those who remember Arthur's golden age.</p> <p>As Morgana's elite hunters close in, Thomas must embrace a destiny larger than he ever imagined. For in a conflict where every victory demands sacrifice, even legendary starships and courageous hearts may not be enough to challenge a dark fate.</p> <p>The resistance rises. The stars bear witness.</p>"; 
